INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19648, 'budget', 'atlas/scopes/ACC/ELP/ELP-001.b/', '', '', 'The budget available for the Launch Project is specified in 9.1.1B. It is a one time budget that doesn’t renew over time, and payouts from the budget can be triggered by a message in the Maker Core forum specifying the amount to pay out (for lump sum payments) or the dssvest parameters (for dssvest payments), and the recipient address. The payment is bundled directly into the next weekly Executive Vote without requiring a Governance Poll. Every time a payout is done, the remaining budget in 9.1.1B must be reduced to reflect the spent amount. Spending cannot exceed the total budget one-time budget.');
