INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19653, 'budget', 'atlas/legacy/spfs/SPF15/', '', '', 'This SPF requested a budget of 50,000 DAI for legal and incorporation expenses of Phoenix Labs, an R&D company focused on creating new products for MakerDAO.');
INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19654, 'budget', 'atlas/legacy/spfs/SPF12/', '', '', 'This SPF requested a 209,000 DAI to support SF-001’s expanded mandate regarding RWAs. "This SPF provides funding for onboarding a structured finance consultant and legal counsel to perform commercial and legal risk analysis on RWAs greenlit by MKR holders and in consideration for onboarding. These contributors will also be responsible for monitoring RWA vaults and developing reporting to provide transparency of vault performance to the community. These individuals will also be helping structure the relationship between Maker Core, future ProtectorDAOs, and the Arrangers, focusing on defining key constraints with the help of the community to ensure Maker Core and DAI holders are protected as we all navigate implementation of the End Game Plan."');
INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19655, 'budget', 'atlas/legacy/spfs/SPF9/', '', '', 'This SPF requested a budget of 258,000 DAI to support onboarding BlockTower Credit as a RWA Arranger pursuant to the greenlight passing. This SPF provides funding for underwriting and performing the legal work necessary to onboard BlockTower Credit.');
INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19657, 'budget', 'atlas/legacy/spfs/SPF7/', '', '', 'This SPF requested a budget of 81,000 DAI to fund the Ambassador Program. The MakerDAO Ambassador program provides non-English speaking communities with resources and educational materials to expand the MakerDAO community. Ambassadors provide two-way translation services, engage their communities with local events, and share content produced in their language with the MakerDAO community.');
INSERT INTO "AnalyticsDimension" (id, dimension, path, label, icon, description) VALUES (19658, 'budget', 'atlas/legacy/spfs/SPF6/', '', '', 'This SPF requested a 50,000 DAI advance for legal expenses relating to domain work in the context of the greenlit bIBTA application. The domain strategy for this collateral type is to evaluate the legal ramifications of onboarding a bIBTA vault. If the legal review is favorable, technical work can continue. If the legal review is unfavorable, it follows to avoid further investment and recommend deprioritizing.');